tus`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (3,'v_is_borrower',20,'SELECT\r\n  deal.user_id,\r\n  1            AS is_borrower\r\nFROM dwd_deal deal\r\n  LEFT JOIN dwd_deal_project proj\r\n    ON CONCAT(deal.project_id,\"_\",deal.system) = proj.source_key_\r\nWHERE proj.name NOT LIKE \"%变现通%\";','dwd_deal','dwd_deal_project',1,1,'2018-11-14 16:52:44',1,'2018-11-16 14:31:00');insert  into `cfg_dataview`(`id`,`view_name`,`cfg_datasource_id`,`view_sql`,`main_tables`,`tables`,`status`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (4,'v_bz_user_profile',20,'SELECT\r\n  u.id,\r\n  u.create_time,\r\n  u.sex,\r\n  u.byear,\r\n  u.user_name,\r\n  u.real_name,\r\n  u.user_purpose,\r\n  u.group_id,\r\n  u.site_id,\r\n  b.refer_user_id,\r\n  g.name,\r\n  ru.id           AS refer_id,\r\n  ru.create_time  AS refer_create_time,\r\n  ru.sex          AS refer_sex,\r\n  ru.byear        AS refer_byear,\r\n  ru.user_name    AS refer_user_name,\r\n  ru.real_name    AS refer_real_name,\r\n  ru.user_purpose AS refer_user_purpose,\r\n  ru.group_id     AS refer_group_id,\r\n  ru.site_id      AS refer_site_id,\r\n  rg.name         AS refer_name,\r\n  tag.last_active_time AS last_active_time\r\nFROM dwb_user_act_tag tag\r\n  LEFT JOIN dwd_user u\r\n    ON tag.source_key_ = u.source_key_\r\n  LEFT JOIN dwd_user_bind b\r\n    ON u.source_key_ = b.source_key_\r\n  LEFT JOIN dwd_user_group g\r\n    ON CONCAT(u.group_id) = g.source_key_\r\n  LEFT JOIN dwd_user ru\r\n    ON CONCAT(b.refer_user_id) = ru.source_key_\r\n  LEFT JOIN dwd_user_group rg\r\n    ON CONCAT(ru.group_id) = rg.source_key_;','dwb_user_act_tag','dwd_user,dwd_user_bind,dwd_user_group',1,1,'2018-11-16 19:32:57',NULL,NULL);insert  into `cfg_dataview`(`id`,`view_name`,`cfg_datasource_id`,`view_sql`,`main_tables`,`tables`,`status`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (5,'v_dwd_invest',20,'SELECT \r\n    act.id_,\r\n    act.user_id,\r\n    act.create_time,\r\n    act.update_time,\r\n    act.id,\r\n    act.deal_id,\r\n    act.money,\r\n    act.is_repay,\r\n    act.source_type,\r\n    act.ip,\r\n    act.short_alias,\r\n    act.system,\r\n    CASE\r\n        WHEN deal.loantype IN (1 , 2) THEN act.money * deal.repay_time / 12 * 0.56\r\n        WHEN\r\n            deal.deal_type != 1\r\n                AND deal.loantype = 5\r\n        THEN\r\n            act.money * deal.repay_time / 360\r\n        WHEN deal.deal_type != 1 THEN act.money * deal.repay_time / 12\r\n        WHEN deal.deal_type = 1 THEN 10 * act.money / 360\r\n    END annual_money\r\nFROM\r\n    dwd_act_invest act\r\n        LEFT JOIN\r\n    dwd_deal deal ON CONCAT(act.deal_id, \'_\', act.system) = deal.source_key_;','dwd_act_invest','dwd_deal',1,1,'2018-12-06 18:26:17',NULL,NULL);insert  into `cfg_dataview`(`id`,`view_name`,`cfg_datasource_id`,`view_sql`,`main_tables`,`tables`,`status`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (6,'v_test_split_table',20,'SELECT\r\n  act.*\r\nFROM user_log_${yyyy_MM_dd} act\r\n  LEFT JOIN dwb_log_ua_info ref\r\n    ON act.ua_md5 = ref.ua_md5\r\nWHERE ref.ua_md5 IS NULL','user_log_${yyyy_MM_dd}','dwb_user_flag',1,1,'2019-03-22 10:43:34',1,'2019-03-22 11:24:48');insert  into `cfg_deployment`(`id`,`code`,`name`,`type`,`datasource_id`,`log_begin_position`,`log_end_position`,`log_begin_timestamp`,`log_end_timestamp`,`labels`,`second_labels`,`status`,`creator_id`,`create_time`,`modifier_id`,`modify_time`,`deploy_json`,`alarm_strategy`) values (2,'33','[通用] firstp2p数据订阅',1,13,NULL,NULL,NULL,NULL,'3','1,3',2,NULL,NULL,NULL,NULL,NULL,NULL);insert  into `cfg_deployment`(`id`,`code`,`name`,`type`,`datasource_id`,`log_begin_position`,`log_end_position`,`log_begin_timestamp`,`log_end_timestamp`,`labels`,`second_labels`,`status`,`creator_id`,`create_time`,`modifier_id`,`modify_time`,`deploy_json`,`alarm_strategy`) values (3,'34','[理财师]beetle_firstp2p',1,13,'','','2018-12-12 17:00:00',NULL,'3','1,3',2,NULL,NULL,1,'2019-01-08 14:3